import React from 'react';
import { Container, CssBaseline, createTheme, ThemeProvider } from '@mui/material';
import SaleForm from './SaleForm';
import SaleList from './SaleList';
import TodaySalesSummary from './TotalSales';
import './App.css'; // Custom CSS for additional styling

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
  typography: {
    fontFamily: 'Arial, sans-serif',
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="md">
        <h1 className="header-title">Sales Tracker</h1>
        <SaleForm />
        <SaleList />
        <TotalSales/>
      </Container>
    </ThemeProvider>
  );
}

export default App;
